    <div className='footer'>
        <h5>CryptoCurrencies</h5>
        <h6>All Rights Reserved</h6>
        <ul>
            <li className='active' onClick={()=>{
              navigate("/")
            }}>
              {/* <Link to="/" className='tag'>Home</Link> */}
              Home
            </li>
            <li className='active' onClick={()=>{
              navigate("/Crypto")
            }}>
              CryptoCurrencies
